#!/usr/bin/env python3
import sys, base64, pickle

class Node:
    __slots__ = ('feature', 'threshold', 'left', 'right', 'value')
    def __init__(self, feature, threshold, left, right, value):
        self.feature = feature
        self.threshold = threshold
        self.left = left
        self.right = right
        self.value = value

_MODEL_BLOB = ''
root = pickle.loads(base64.b64decode(_MODEL_BLOB))

def predict(node, features):
    if node.feature is None:
        return node.value
    if features[node.feature] <= node.threshold:
        return predict(node.left, features)
    return predict(node.right, features)


def main():
    if len(sys.argv) != 4:
        sys.exit('Usage: run.sh <trip_duration_days> <miles_traveled> <total_receipts_amount>')
    try:
        x = [float(sys.argv[1]), float(sys.argv[2]), float(sys.argv[3])]
    except:
        sys.exit(1)
    y = predict(root, x)
    sys.stdout.write(f"{y:.2f}")


if __name__ == '__main__':
    main()
